// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awPanelSectionRenderFunction } from 'js/AwPanelSectionService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwPanelSectionService', () => import('js/AwPanelSectionService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awPanelSectionRenderFunction",
            "deps": "js/AwPanelSectionService"
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "ctx": {
        "toggleLabel": null
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "caption": {
            "type": "string"
        },
        "name": {
            "type": "string"
        },
        "collapsed": {
            "type": "string"
        },
        "toggle-action": {
            "type": "action"
        },
        "include-component-name": {
            "type": "string"
        }
    },
    "_viewModelId": "AwPanelSection",
    "_uniqueViewModelId": "AwPanelSection"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awPanelSectionRenderFunction, undefined, ctxImportObj );

export default Component;
